import React, { useEffect, useRef } from 'react';
import axios from 'axios';

function Player() {
    const [seasonStats, setSeasonStats] = useState([])

    useEffect(() => {
        axios.get("http://localhost:8080/player")
        .then((data) => {
            setSeasonStats(data)
        })
    }, []);

    console.log(seasonStats)
    return (
        <div>
            <p>test</p>
        </div>
    )
}

export default Player;
